  yOffset: 0,
  xOffset: 0,
  transform: ''
};
export const Html5Icon = props => {
  const newProps = Object.assign({
    config: Html5IconConfig
  }, props);
  return React.createElement(SVGIcon, newProps);
};
export default Html5Icon;
